import React from 'react'
//import Link from 'next/link'
//import Head from 'next/head'
//import FaviIcon from '../../atoms/atFavIcon'
import Layout from '../../moleculas/layout'
import MoHead from '../../moleculas/moHead'
import Tanque from '../../organisms/orgTanque'
import * as Util from '../../../controller/util.js';

function retornaogame(modo,regiao){
  if (modo=="html"){ 
    return (<Tanque/>) 
  }else{ 
    return (
      <p>O jogo não pode ser visto no modo AMP.<br/>
        <a href={"/game/controleogodzilla/?regiao="+regiao}>Clique aqui para sair do modo AMP.</a>
      </p>
      )
  }
}

const atendimentoOi = function (props) {

  console.log('╔════════════════════════════════════════╗');
  console.log('║  Template - GAME - Tanque de Guerra    ║');
  console.log('╚════════════════════════════════════════╝');

  var regiao = Util.validaProps(props.regiao , "RJ");
  var modo = Util.validaProps(props.modo, "html");   



  return (
    <div>
      <MoHead modo={modo} title="Teste Game Tanque PhaserJS" description="Desenvolvimento de Game com PhaserJS - Tanque de Guerra." canonical="/"/>
      <Layout regiao={regiao} modo={modo}>
          <h1>Teste Game Tanque PhaserJS</h1>
          <p>Estudo de desenvolvimento de game com PhaserJS.</p>
          {retornaogame(modo,regiao)}
          <br/>
          S=Andar para traz<br/>
          W=Andar para frente<br/>
          A=Virar para a esquerda<br/>
          D=Virar para a direita<br/>
      </Layout>
      <style jsx>{`
        .divgametanque {
          position: absolute;
        }
        .btLinkBranco {
            font-family: oiTextRegular, sans-serif;
            background-color: #ffffff;
            border-radius: 8px;
            color: #222222;
            display: block;
            font-size: 1rem; /*16px*/
            height: 3.42857143rem;
            text-align: center;
            width: 300px;
            text-decoration: none;
            border: solid 1px #dbdbdb;
            cursor: pointer;
            outline: 0;
            margin: 0;
            padding: 1.2rem;
            box-sizing: border-box;
            font-style: normal;
            transition: 0.5s;
            -webkit-box-shadow: 2px 2px 20px rgba(1, 1, 1, 0.17);
            -moz-box-shadow: 2px 2px 20px rgba(1, 1, 1, 0.17);
            box-shadow: 2px 2px 20px rgba(1, 1, 1, 0.17);
          }
          .btLinkBranco:hover {
            -webkit-box-shadow: 1px 1px 10px rgba(1, 1, 1, 0.47);
            -moz-box-shadow: 1px 1px 10px rgba(1, 1, 1, 0.47);
            box-shadow: 1px 1px 10px rgba(1, 1, 1, 0.47);
          }
      `}</style>

    </div>
  )
}

